SET FOREIGN_KEY_CHECKS = 0;

DROP TABLE IF EXISTS  `business_ad`;
CREATE TABLE `business_ad` (
  `ad_id` bigint(6) NOT NULL AUTO_INCREMENT COMMENT '广告ID',
  `position_id` bigint(6) DEFAULT NULL COMMENT '位置ID',
  `ad_name` varchar(100) DEFAULT NULL COMMENT '广告名称',
  `ad_img` longtext COMMENT '广告图片',
  `ad_img_link` varchar(255) DEFAULT NULL COMMENT '广告图片链接',
  `ad_link` varchar(255) DEFAULT NULL COMMENT '广告链接',
  `ad_code` text COMMENT '广告编码',
  `start_time` datetime DEFAULT NULL COMMENT '开始时间',
  `end_time` datetime DEFAULT NULL COMMENT '结束时间',
  `click_count` mediumint(8) DEFAULT NULL COMMENT '点击次数',
  `description` varchar(100) DEFAULT NULL COMMENT '描述',
  PRIMARY KEY (`ad_id`)
) ENGINE=InnoDB AUTO_INCREMENT=30 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='广告';

DROP TABLE IF EXISTS  `business_ad_position`;
CREATE TABLE `business_ad_position` (
  `position_id` bigint(3) NOT NULL AUTO_INCREMENT COMMENT '广告位ID',
  `position_code` varchar(50) NOT NULL COMMENT '位置编码',
  `position_name` varchar(60) DEFAULT NULL COMMENT '广告位名称',
  `ad_width` smallint(5) DEFAULT NULL COMMENT '广告位宽度',
  `ad_height` smallint(5) DEFAULT NULL COMMENT '广告位高度',
  `position_desc` varchar(255) DEFAULT NULL COMMENT '广告位描述',
  PRIMARY KEY (`position_id`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='广告位置';

DROP TABLE IF EXISTS  `business_attention`;
CREATE TABLE `business_attention` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `group_id` bigint(20) DEFAULT '0' COMMENT '团id',
  `goods_id` bigint(20) DEFAULT '0' COMMENT '商品主键',
  `user_id` bigint(20) DEFAULT '0' COMMENT '用户ID',
  `openid` varchar(70) DEFAULT '0' COMMENT 'openid',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=86 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='商品或者团的关注';

DROP TABLE IF EXISTS  `business_category`;
CREATE TABLE `business_category` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '分类id',
  `parent_id` bigint(20) unsigned DEFAULT NULL COMMENT '父分类的id',
  `name` varchar(90) DEFAULT NULL COMMENT '分类名称',
  `path` varchar(200) DEFAULT NULL COMMENT '分类路径',
  `sort_order` int(10) unsigned DEFAULT NULL COMMENT '排序',
  `is_show` int(10) unsigned DEFAULT NULL COMMENT '是否显示',
  `cat_ico` varchar(255) DEFAULT NULL COMMENT '分类标志',
  `cat_logo` varchar(255) DEFAULT NULL COMMENT '分类LOGO',
  PRIMARY KEY (`id`),
  KEY `parent_id` (`parent_id`)
) ENGINE=InnoDB AUTO_INCREMENT=22 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='商品分类';

DROP TABLE IF EXISTS  `business_favorite`;
CREATE TABLE `business_favorite` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '收藏主键',
  `group_id` bigint(20) DEFAULT '0' COMMENT '团id',
  `goods_id` bigint(20) DEFAULT '0' COMMENT '商品主键',
  `user_id` bigint(20) DEFAULT '0' COMMENT '用户ID',
  `openid` varchar(70) DEFAULT '0' COMMENT 'openid',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=150 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='团收藏';

DROP TABLE IF EXISTS  `business_goods`;
CREATE TABLE `business_goods` (
  `id` bigint(10) NOT NULL AUTO_INCREMENT COMMENT '商品ID',
  `category_id` bigint(20) DEFAULT '1' COMMENT '商品分类id',
  `goods_desc` longtext COMMENT '商品详情',
  `goods_name` varchar(120) DEFAULT '' COMMENT '商品名称',
  `goods_number` int(50) DEFAULT NULL COMMENT '商品数量',
  `goods_code` varchar(64) DEFAULT NULL COMMENT '商品编码',
  `goods_original_price` decimal(10,2) DEFAULT NULL COMMENT '商品原价',
  `promote_price` decimal(10,2) DEFAULT NULL COMMENT '促销价',
  `saled_number` int(10) DEFAULT NULL COMMENT '已售数量',
  `goods_thumb` varchar(255) DEFAULT '' COMMENT '商品相册',
  `goods_main_img` varchar(255) DEFAULT '' COMMENT '商品主图',
  `goods_original_img` varchar(255) DEFAULT '' COMMENT '商品原图',
  `is_onsale` tinyint(1) DEFAULT '0' COMMENT '商品是否下架',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=163 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='商品活动';

DROP TABLE IF EXISTS  `business_goods_group`;
CREATE TABLE `business_goods_group` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `goods_id` bigint(20) NOT NULL COMMENT '商品主键',
  `type` int(11) DEFAULT NULL COMMENT '拼团类型',
  `num` int(11) DEFAULT NULL COMMENT '拼团人数',
  `group_price` decimal(10,2) DEFAULT NULL COMMENT '拼团价',
  `start_time` datetime DEFAULT NULL COMMENT '拼团开始时间',
  `end_time` datetime DEFAULT NULL COMMENT '拼团结束时间',
  `duration` int(11) DEFAULT NULL COMMENT '持续时间：天',
  `group_num` int(11) DEFAULT '0' COMMENT '已经开始的团数量',
  `status` varchar(20) DEFAULT NULL COMMENT '团商品状态',
  PRIMARY KEY (`id`),
  KEY `FK2ldohhi8jxpipebd4mbkcle3c` (`goods_id`)
) ENGINE=InnoDB AUTO_INCREMENT=57 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='商品拼团管理';

DROP TABLE IF EXISTS  `business_goods_img`;
CREATE TABLE `business_goods_img` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '商品相册ID',
  `goods_id` bigint(20) NOT NULL COMMENT '商品ID',
  `original_img` varchar(100) DEFAULT NULL COMMENT '商品原图',
  `small_thumb_img` varchar(100) DEFAULT NULL COMMENT '商品缩略图1',
  `big_thumb_img` varchar(100) DEFAULT NULL COMMENT '商品缩略图2',
  PRIMARY KEY (`id`,`goods_id`)
) ENGINE=InnoDB AUTO_INCREMENT=75 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='商品图片';

DROP TABLE IF EXISTS  `business_goods_sku`;
CREATE TABLE `business_goods_sku` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '商品属性ID',
  `goods_id` bigint(20) DEFAULT NULL COMMENT '商品id',
  `sku_name` varchar(100) DEFAULT NULL COMMENT '属性值',
  `price` decimal(10,0) DEFAULT '0' COMMENT '商品价格',
  `stock` int(100) DEFAULT NULL COMMENT '该sku库存',
  `code` varchar(100) DEFAULT NULL COMMENT '商品条形码',
  `weight` smallint(50) DEFAULT NULL COMMENT '商品重量',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=123 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='商品SKU';

DROP TABLE IF EXISTS  `business_recommend_goods`;
CREATE TABLE `business_recommend_goods` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `goods_id` int(11) NOT NULL COMMENT '商品id',
  `position_id` int(11) NOT NULL COMMENT '位置id',
  `orderby` int(10) DEFAULT NULL COMMENT '排序',
  `sort` int(2) DEFAULT '0' COMMENT '该商品在该位置的排序位置',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=156 DEFAULT CHARSET=utf8 COLLATE=utf8_bin ROW_FORMAT=DYNAMIC COMMENT='商品 位置 关系表';

DROP TABLE IF EXISTS  `business_recommend_group`;
CREATE TABLE `business_recommend_group` (
  `id` bigint(10) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `group_id` bigint(10) DEFAULT NULL COMMENT '拼团组ID',
  `position_id` int(10) DEFAULT NULL COMMENT '位置id',
  `orderby` int(10) DEFAULT NULL COMMENT '排序',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=81 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='推荐拼团';

DROP TABLE IF EXISTS  `business_recommend_position`;
CREATE TABLE `business_recommend_position` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `position_name` varchar(50) CHARACTER SET utf8 DEFAULT NULL COMMENT '位置名称',
  `code` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '位置编码',
  PRIMARY KEY (`id`),
  UNIQUE KEY `code` (`code`)
) ENGINE=InnoDB AUTO_INCREMENT=22 DEFAULT CHARSET=utf8 COLLATE=utf8_bin ROW_FORMAT=DYNAMIC COMMENT='位置表';

DROP TABLE IF EXISTS  `business_user_address`;
CREATE TABLE `business_user_address` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT COMMENT '地址id',
  `address_name` varchar(50) DEFAULT NULL COMMENT '地址名称',
  `user_id` mediumint(8) unsigned DEFAULT NULL COMMENT '会员id',
  `openid` varchar(120) DEFAULT NULL COMMENT 'openid',
  `consignee` varchar(60) DEFAULT NULL COMMENT '收货人姓名',
  `email` varchar(60) DEFAULT NULL COMMENT 'email',
  `country` smallint(5) DEFAULT NULL COMMENT '国家',
  `county_name` varchar(50) DEFAULT NULL COMMENT '国家名称',
  `province` smallint(5) DEFAULT NULL COMMENT '省',
  `province_name` varchar(50) DEFAULT NULL COMMENT '省名称',
  `city` smallint(5) DEFAULT NULL COMMENT '市',
  `city_name` varchar(50) DEFAULT NULL COMMENT '城市名称',
  `district` smallint(5) DEFAULT NULL COMMENT '区、县',
  `district_name` varchar(50) DEFAULT NULL COMMENT '区县名称',
  `address` varchar(120) DEFAULT NULL COMMENT '地址',
  `zipcode` varchar(60) DEFAULT NULL COMMENT '邮编',
  `tel` varchar(60) DEFAULT NULL COMMENT '电话',
  `mobile` varchar(60) DEFAULT NULL COMMENT '手机',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=407 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='会员地址';

