DROP TABLE IF EXISTS  `pay_payment`;
CREATE TABLE `pay_payment` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '支付主键',
  `code` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '支付编码',
  `name` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '支付名称',
  `type` varchar(10) COLLATE utf8_bin DEFAULT NULL COMMENT '支付类型：online,offline,bank,cod',
  `remark` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '备注',
  `order_sort` int(11) NOT NULL DEFAULT '0' COMMENT '排序',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COLLATE=utf8_bin ROW_FORMAT=DYNAMIC COMMENT='支付方式';

DROP TABLE IF EXISTS  `pay_payment_config`;
CREATE TABLE `pay_payment_config` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `payment_id` bigint(20) DEFAULT NULL COMMENT '支付主键',
  `code` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '参数名',
  `value` varchar(1000) COLLATE utf8_bin DEFAULT NULL COMMENT '参数值',
  `remark` varchar(500) COLLATE utf8_bin DEFAULT NULL COMMENT '参数说明',
  `order_sort` int(11) DEFAULT '0' COMMENT '排序',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=25 DEFAULT CHARSET=utf8 COLLATE=utf8_bin ROW_FORMAT=DYNAMIC COMMENT='支付配置参数';

DROP TABLE IF EXISTS  `system_api`;
