DROP TABLE IF EXISTS  `trade_shipping`;
CREATE TABLE `trade_shipping` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `shipping_name` varchar(100) DEFAULT NULL COMMENT '配送方式名称',
  `enabled` tinyint(2) DEFAULT NULL COMMENT '是否可用:1，是；2，否',
  `last_update_time` datetime DEFAULT NULL COMMENT '最后更新时间',
  `init_start` int(11) DEFAULT NULL COMMENT '首重',
  `init_fee` decimal(10,2) DEFAULT NULL COMMENT '首费',
  `add_start` int(11) DEFAULT NULL COMMENT '续重',
  `add_fee` decimal(10,2) DEFAULT NULL COMMENT '续费',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='配送方式';

DROP TABLE IF EXISTS  `trade_shipping_fee`;
CREATE TABLE `trade_shipping_fee` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
  `shipping_id` bigint(20) unsigned NOT NULL COMMENT '配送方式',
  `region_area` varchar(100) NOT NULL COMMENT '地区区域',
  `init_start` int(11) DEFAULT NULL COMMENT '首重',
  `init_fee` decimal(10,2) DEFAULT NULL COMMENT '首费',
  `add_start` int(11) DEFAULT NULL COMMENT '续重',
  `add_fee` decimal(10,2) DEFAULT NULL COMMENT '续费',
  `region_id` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `shipping_id` (`shipping_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='快递地区运费';

DROP TABLE IF EXISTS  `trade_tuan`;
CREATE TABLE `trade_tuan` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '团ID',
  `group_id` bigint(11) DEFAULT NULL COMMENT '商品ID',
