DROP TABLE IF EXISTS  `wx_app_auth`;
CREATE TABLE `wx_app_auth` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `authorizer_appid` varchar(20) DEFAULT NULL COMMENT '授权方appid',
  `authorizer_access_token` varchar(200) DEFAULT NULL COMMENT '令牌',
  `authorizer_refresh_token` varchar(200) DEFAULT NULL COMMENT '据刷新令牌',
  `expires_in` int(11) DEFAULT NULL COMMENT '有效期',
  `modified` datetime DEFAULT NULL COMMENT '更新时间',
  `nick_name` varchar(50) DEFAULT NULL COMMENT '昵称',
  `head_img` varchar(180) DEFAULT NULL COMMENT '授权方头像',
  `user_name` varchar(50) DEFAULT NULL COMMENT '原始ID',
  `principal_name` varchar(50) DEFAULT NULL COMMENT '主体名称',
  `alias` varchar(50) DEFAULT NULL COMMENT '所设置的微信号',
  `business_info` varchar(300) DEFAULT NULL COMMENT '功能的开通状况',
  `qrcode_url` varchar(180) DEFAULT NULL COMMENT '二维码图片的URL',
  `func_info` varchar(300) DEFAULT NULL COMMENT '权限集列表',
  `authorization_info` varchar(300) DEFAULT NULL COMMENT '授权信息',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='微信授权APP';

DROP TABLE IF EXISTS  `wx_app_config`;
CREATE TABLE `wx_app_config` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `code` varchar(50) DEFAULT NULL COMMENT '配置名称',
  `value` varchar(300) DEFAULT NULL COMMENT '配置值',
  `remark` varchar(300) DEFAULT NULL COMMENT '备注',
  `modified` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='微信开发者账号配置';

DROP TABLE IF EXISTS  `wx_app_user`;
CREATE TABLE `wx_app_user` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `appid` varchar(50) NOT NULL COMMENT '公众号ID',
  `openID` varchar(100) NOT NULL COMMENT '窗口id',
  `nickname` varchar(100) DEFAULT NULL COMMENT '昵称',
  `address_id` bigint(20) DEFAULT NULL COMMENT '地址ID',
  `realname` varchar(10) DEFAULT NULL COMMENT '真实姓名',
  `sex` varchar(10) DEFAULT NULL COMMENT '性别',
  `language` varchar(10) DEFAULT NULL COMMENT '语言',
  `province` varchar(10) DEFAULT NULL COMMENT '省份',
  `city` varchar(10) DEFAULT NULL COMMENT '城市',
  `country` varchar(10) DEFAULT NULL COMMENT '国家',
  `headimgurl` varchar(255) DEFAULT NULL COMMENT '头像路径',
  `privilege` varchar(10) DEFAULT NULL COMMENT '权限',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='微信公众号的用户';

SET FOREIGN_KEY_CHECKS = 1;

